import { useState } from "react";
import Card from "../Card/Card.component";
import a from "../../assets/images/audi.png";
import b from "../../assets/images/bmw.jpeg";
import f from "../../assets/images/ferrari.png";
import l from "../../assets/images/lamborghini.png";
import m from "../../assets/images/Mercedes.png";
import p from "../../assets/images/porsche.png";
import r from "../../assets/images/rolls.jpeg";
import v from "../../assets/images/volvo.png";

function Cards() {
  const [items, setItems] = useState([
    { id: 1, img: a, stat: "" },
    { id: 1, img: a, stat: "" },
    { id: 2, img: b, stat: "" },
    { id: 2, img: b, stat: "" },
    { id: 3, img: b, stat: "" },
    { id: 3, img: b, stat: "" },
    { id: 4, img: b, stat: "" },
    { id: 4, img: "../../assets/images/lamborghini.png", stat: "" },
    { id: 5, img: "../../assets/images/Mercedes.png", stat: "" },
    { id: 5, img: "../../assets/images/Mercedes.png", stat: "" },
    { id: 6, img: "../../assets/images/porsche.png", stat: "" },
    { id: 6, img: "../../assets/images/porsche.png", stat: "" },
    { id: 7, img: "../../assets/images/rolls.jpeg", stat: "" },
    { id: 7, img: ".../../assets/images/rolls.jpeg", stat: "" },
    { id: 8, img: "../../assets/images/volvo.png", stat: "" },
    { id: 8, img: "../../assets/images/volvo.png", stat: "" },
  ]);
  return (
    <div className="container">
      {items.map((item, index) => (
        <Card key={index} item={item} />
      ))}
    </div>
  );
}

export default Cards;
